    /**
     * 显示所有的keyword,并进行分页
     * @param page
     * @param limit
     * @return
     */
    @RequestMapping("admin/keyword/list")
    public BaseRespVo showKeywords(int page, int limit, String sort, String order, String keyword, String url){
        //查询所有的keyword并分页
        Map map = marketService.queryKeyword(page, limit,keyword,url,sort,order);
        List<Keyword> keywords = (List<Keyword>)map.get("keywords");
        int total = (int)map.get("total");
        BaseRespVo baseRespVo = new BaseRespVo();
        baseRespVo.setErrmsg("成功");
        baseRespVo.setErrno(0);
        //设置data,用map接收
        Map<String,Object> resultMap = new HashMap<>();
        resultMap.put("total",total);
        resultMap.put("items",keywords);
        baseRespVo.setData(resultMap);
        return baseRespVo;
    }

    /**
     * 新加keyword
     * @param keyword
     * @return
     */
    @RequestMapping("admin/keyword/create")
    public BaseRespVo CreateKeyword(@RequestBody Keyword keyword){
        keyword.setAddTime(new Date());
        keyword.setUpdateTime(new Date());
        keyword.setDeleted(false);
        keyword.setSortOrder(100);
        Keyword keyword1 = marketService.insertKeyword(keyword);
        BaseRespVo baseRespVo = new BaseRespVo();
        baseRespVo.setErrno(0);
        baseRespVo.setErrmsg("成功");
        baseRespVo.setData(keyword1);
        return baseRespVo;
    }

    /**
     * 更新关键字
     * @param keyword
     * @return
     */
    @RequestMapping("admin/keyword/update")
    public BaseRespVo updateKeyword(@RequestBody Keyword keyword){
        BaseRespVo baseRespVo = new BaseRespVo();
        Keyword reslutKeyword = marketService.updateKeyword(keyword);
        baseRespVo.setErrno(0);
        baseRespVo.setData(reslutKeyword);
        baseRespVo.setErrmsg("成功");
        return baseRespVo;
    }

    /**
     * 删除关键字
     * @param keyword
     * @return
     */
    @RequestMapping("admin/keyword/delete")
    public BaseRespVo delectKeyword(@RequestBody Keyword keyword){
        Integer id = keyword.getId();
        marketService.deleteKeywordById(id);
        BaseRespVo baseRespVo = new BaseRespVo();
        baseRespVo.setErrmsg("成功");
        baseRespVo.setErrno(0);
        return baseRespVo;
    }


